import './App.scss';
import Navbar from './components/Navbar/Navbar'
import {BrowserRouter} from 'react-router-dom';
import { useRoutes } from './routes';

function App() {
  const routes = useRoutes()

  return (
    <div className="app">
      <BrowserRouter>
        <Navbar />
        { routes }
      </BrowserRouter>
    </div>
  );
}

export default App;
